import React, { Component, PropTypes } from 'react';
import AppBar from '@material-ui/core/AppBar';
import ToolBar from '@material-ui/core/ToolBar';
import { Button } from '@material-ui/core';
import {Link} from 'react-router-dom';

class NavBar extends Component {
    constructor(props) {
        super(props);

    }



    render() {
        return (
            <AppBar>
                <ToolBar>
                    <Button component={Link} to="/">Home</Button>
                    <Button component={Link} to="/testvscases">Tests v/s Cases Summary</Button>
                    <Button component={Link} to="/agegroup">Distribution wrt Age groups</Button>
                    <Button component={Link} to="/hospitalsbeds">Hospitalizations Summary</Button>
                </ToolBar>

            </AppBar>
        );
    }
}



export default NavBar;
